import React from 'react'
import Room from './Room';

export default function RoomList({ rooms }) {

    if (rooms.length === 0) {
        return (
            <div className="empty-search">


                <h3> no rooms
        </h3>
            </div>
        )
    }
    return (
        <section className="roomslist-center"
        >
            {
                rooms.map(item => {
                    return <Room key={item.id} room={item} />
                })
            }


        </section>
    )

}
